        transform: $animation;
      }
    }
  }

  &__copyright {
    letter-spacing: -0.01em;
    color: $grey-color;
  }
}

sources.styles/blocks/grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 16px;
  @include onTablet {
    grid-template-columns: repeat(8, 1fr);
    gap: 24px;
  }
  @include onDesktop {
    grid-template-columns: repeat(8, 1fr);
    gap: 24px;
  }
  @include onLargeScreen {
    grid-template-columns: repeat(8, 1fr);
    gap: 24px;
  }

  &__item {
    @for $start from 1 through 2 {
      @for $end from $start through 2 {
        &--mobile-#{$start}-#{$end} {
          grid-column: #{$start}/#{$end+1};
        }
      }
    }

    @for $start from 1 through 8 {
      @for $end from $start through 8 {
        &--tablet-#{$start}-#{$end} {
          @include onTablet {
            grid-column: #{$start}/#{$end+1};
          }
        }
      }
    }

    @for $start from 1 through 8 {
      @for $end from $start through 8 {
        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start}/#{$end+1};
          }
        }
      }
    }

    @for $start from 1 through 8 {
      @for $end from $start through 8 {
        &--largeScreen-#{$start}-#{$end} {
          @include onLargeScreen {
            grid-column: #{$start}/#{$end+1};
          }
        }
      }
    }
  }
}

sources.styles/blocks/header.scss:
.header {
  width: 100%;
  height: 100vh;
  margin-bottom: 72px;
  @include onTablet {
    margin-bottom: 152px;
  }
  @include onLargeScreen {
    margin-bottom: 178px;
  }

  &__top {
    height: 64px;
    padding: 16px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    align-self: center;
    @include onDesktop {
      height: 88px;
      padding: 32px;
    }
  }

  &__menu {
    width: 24px;
    height: 24px;
    background-position: center;
    background-repeat: no-repeat;
    transition: background-image 0.3s;
    background-image: url(../images/menu.svg);
    &:hover {
      background-image: url(../images/Icon-menu.svg);
    }
    @include onDesktop {
      display: none;
    }
  }

  &__content {
    padding-top: 32px;
    display: flex;
    flex-direction: column;
    align-items: center;
    @include onTablet {
      position: relative;
      align-items: flex-start;
      padding: 80px 44px 0;
    }
    @include onDesktop {
      padding-top: 135px;
    }
    @include onLargeScreen {
      padding: 144px 124px 0;
    }
  }

  &__description {
    width: 288px;
    font-weight: 400;
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    color: $black-color;
    margin-bottom: 32px;
    text-align: center;
    @include onTablet {
      text-align: left;
      margin-bottom: 146px;
      width: 280px;
    }
    @include onDesktop {
      margin-bottom: 8px;
      width: 260px;
    }
    @include onLargeScreen {
      margin-bottom: 40px;
      width: 280px;
    }
  }

  &__title {
    width: 288px;
    font-weight: 400;
    font-size: 64px;
    line-height: 54px;
    text-align: center;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    @include onTablet {
      width: 100%;
      font-size: 80px;
      line-height: 68px;
      white-space: nowrap;
      margin-bottom: 210px;
    }
    @include onDesktop {
      font-size: 116px;
      line-height: 116px;
      margin-bottom: 64px;
      width: 100%;
    }
    @include onLargeScreen {
      font-size: 120px;
      line-height: 122px;
    }
  }

  &__img-box {
    width: 100%;
    display: block;
    margin: 0 auto;
    max-width: 288px;

    @include onTablet {
      position: absolute;
      top: 140px;
      left: 0;
      right: 0;
      z-index: -1;
      max-width: 326px;
    }
    @include onDesktop {
      max-width: 544px;
      top: 0;
    }
    @include onLargeScreen {
      max-width: 584px;
    }
  }

  &__image {
    display: block;
    padding-bottom: 100%;
    background-image: url(../images/cookie.svg);
    background-size: contain;
    background-position: center;
    background-repeat: no-repeat;
  }

  &__box-but {
    display: flex;
    justify-content: center;
    align-self: center;
    @include onDesktop {
      align-self: flex-start;
    }
  }

  &__button {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 280px;
    height: 56px;
    border: 2px solid $accent-color;
    border-radius: 32px;
    color: $accent-color;
    font-weight: 500;
    font-size: 16px;
    line-height: 16px;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    text-decoration: none;
    text-align: center;
    transition: background-color 0.3s, color 0.3s, border-color 0.3s;
    &::before {
      display: inline-block;
      content: "";
      background-image: url(../images/Icon-cookie.svg);
      background-size: auto;
      background-repeat: no-repeat;
      height: 24px;
      width: 24px;
      margin-right: 6px;
      transition: background-image $duration;
    }
    &:hover {
      background-color: $accent-color;
      color: #fff;
      &::before {
        background-image: url(../images/hover-cookie.svg);
      }
    }
    &:active {
      background-color: #b2341a;
      border-color: #b2341a;

    }
  }
}

