sources.styles/blocks/page.scss:
.page {
  font-family: "Inter", sans-serif;
  font-style: normal;
  font-weight: 400;
  font-size: 16px;
  line-height: 24px;
  color: $black-color;
  scroll-behavior: smooth;

  &__section {
    margin: 0 auto;
    max-width: 1440px;
  }

  &__menu {
    margin: 0 auto;
    max-width: 1440px;
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    transform: translateX(100%);
    transition: transform 0.3s;
    &:target {
      transform: translateX(0);
    }
  }

  &__body {
    background-color: #eef7ff;
    margin: 0;
    &--menu {
      overflow-y: hidden;
    }
  }
}
